        variant="h4"
        align="center"
        component="h1"
        style={{ padding: 16 }}
      >
        Parking Slots
      </Typography>
      <Paper style={{ padding: 16 }}>
        <Grid container justify="center" alignItems="center" spacing={2}>
          {NumberOfSlot.map((data,index) => {
